import React from "react";
import './project.css';

export default function Projects(){
    return(
        <>
        <div className="project" id="projects">
              <div className="project-container">
                      <div className="layer1"></div>
                      <div className="layer2"></div>
                      <div className="layer3"></div>
              </div>
        </div>
        </>
    );
}
